var data = [...professions, ...categories, ...companies];


function getSearchData(query, limit) {
    console.log(query);




    var options = {
        keys: ['label'],
        tokenize: true,
        location: 0,
        threshold: 0
    };
    f1 = new Fuse(data, options);
    let result = f1.search(query);
    let final = [];
    for (let i = 0, max = result.length; i < max && i < (limit - 1); i++) {
        final.push(result[i]);
    }
    final.unshift({value: query, label: query, customProperties: {type: "keyword"}});
    return final;
}

